/**
 * Created by kripa on 17/2/20.
 */
import React from 'react';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';
import AgencyListComponent from './AgencyListComponent';
import '../../App.css';
import {Link} from "react-router-dom";
import {RENDER_URL} from '../../Utils/Urls';

const ManageAgencyContainer = () => {
    return (
        <div>
            <MenuComponent/>
            <div className="jumbotron">
                <Link to={RENDER_URL.AGENCY_URL} className="btn btn-secondary">Create Agency</Link>
            </div>
            <AgencyListComponent/>
            <FooterComponent/>
        </div>
    )
};

export default ManageAgencyContainer;
